import React from "react";
import "./App.css";
import Row from "./Row";
import requests from "./requests";
function App() {
  return (
    <div className="app">
      <Row
        title="NETFLIX ORIGINALS"
        fetchUrl={requests.fetchNetflixOriginals}
        isLargeRow
      />
    </div>
  );
}

export default App;

